import React,{ useState } from 'react'
import './static/css/App.css';
import Header from './layout/header';
import Footer from './layout/footer';
import Registration from './pages/registration';
import Login from './pages/login';
import Cookie from './pages/coocie';
import Page404 from './pages/404';
import Home from './pages/home';
import { Routes, Route } from 'react-router-dom'

function App() {


  const headers = [
    {id:1,link:'',title:'Главная'},
    {id:2,link:'login',title:'Логин'},
    {id:3,link:'registration',title:'Регисстрация'},
    {id:4,link:'api/create_todo',title:'Create todo'},
    {id:5,link:'home3',title:'О нас'},
  ]
  const [title,changeTitle] = useState('Register')

  function change(){
    if (title === 'Register') {
      changeTitle('Login')      
    }else{
      changeTitle('Register')      
    }
  }


  return (
    <>
    <Cookie/>
    <Header headers={headers}/>
    {/* <h2 onClick={(() => change('title'))}>{title}</h2> */}
    <h2 onClick={change}>{title}</h2>

    <div className="content">
      <Routes>
        <Route path='' element={<Home/>}/>
        <Route path='/login' element={<Login/>}/>
        <Route path='/registration' element={<Registration/>}/>
        <Route path='*' element={<Page404/>}/>
      </Routes>



    </div>
    <Footer/>
    </>
  );
}

export default App;
